(1571, 16, 36, ' Cermati kutipan resensi berikut dengan saksama! <br>Pertemuan Dua Hati, karya N.H. Dini terbitan PT Gramedia Tahun 1986 dengan tebal buku 85 halaman, menyuguhkan gambar dan kata-kata yang memikat pembaca, di samping unsure yang lain. Sampul buku didominasi warna hijau dengan latar belakang pepohonan. Ilustrasi utama gambar sesosok wanita yang berhadapan dengan seorang bocah cilik. Jika dilihat sepintas, sepertinya sampul buku menggambarkan kasih sayang ibu terhadap anaknya. <br>Kutipan tersebut termasuk ke dalam resensi buku fiksi karena &hellip;.<br>', 1, 'Memberikan penilaian buku secara subyektif', 'Menjelaskan biografi pengarang', 'Mengemukakan identitas buku secara lengkap', 'Membahas penggunaan bahasa dan pengarang', 'Mengungkapkan unsure intrinsiknya saja', 'C', NULL, '', '', '', '', '', ''),
(1572, 16, 37, ' Perhatikan kutipan naskah drama berikut! <br>Maya : Pokoknya, Ibu harus setuju! <br>Ibu : (menarik napas panjang kecewa) Dengan apa Ibu membayarnya? <br>Maya : (terkejut dan gugup) Kan masih lama, Ibu. <br>Ibu : Biaya kursus cukup besar, Maya. <br>Maya : [&hellip;]<br>Ibu : (dengan tersenyum) Nah, begitu. Ini gres putri Ibu. <br>Dialog yang sempurna untuk melengkapi cuilan rumpang kutipan drama tersebut yakni &hellip; <br>', 1, 'Iya deh, Maya turuti nasihat Ibu.', 'Maya, kita kini lagi kesulitan.', 'Coba kau mengerti kondisi Ibu.', 'Baiklah Ibu akan beli yang baru', 'Coba ibu pikirkan dulu.', 'A', NULL, '', '', '', '', '', ''),
