(1576, 16, 41, ' Cermati penggalan drama berikut! <br>Ayu : Sudah malam lo Sis, kita harus segera pulang <br>Siska : Sudahlah Yu, tenang saja toh ini baru jam sembilan lebih sedikit. Jalanan masih ramaiAyu : Ih, sudah malam begini kok tenang. Kan kita perempuan, masak pulang sampai larut malam. <br>  Tidak enak kan dengan tentangga. Nanti mereka mengira kita suka keluyuran malam. <br>Siska : (Dengan sikap tenang) Sudah, nanti saya antar kamu. Memang repot, kita ini perempuan <br>  tidak wajar kalau pulang terlalu malam. Kita pun tidak berani melanggar aturan <br>   tidak tertulis di masyarakat kita ini. <br>Penggalan drama tersebut mengandung nilai.... <br>', 1, 'sosial', 'moral', 'budaya', 'agama', 'pendidikan', 'C', NULL, '', '', '', '', '', ''),
(1577, 16, 42, ' Bacalah penggalan teks drama berikut! <br>Jupri : Teman-teman bolehkah aku bergabung bersama kalian? <br>Lenih: Oh, tentu saja mari sini! <br>Jupri: Kalian sedang apa? <br>Wilda: Kami sedang mengumpulkan baju-baju bekas untuk disumbangkan ke komunitas anak   jalanan. <br>Jupri: Waaah, kebetulan! Aku punya banyak sekali pakaian bekas. Boleh aku sumbangkan? <br>Leni: Tentu boleh. <br>Watak Wilda dalam penggalan teks tersebut adalah .... <br>', 1, 'sombong', 'pemurah', 'pendendam', 'peduli', 'suka pamer', 'D', NULL, '', '', '', '', '', ''),
(1578, 16, 43, ' Bacalah penggalan drama berikut ini! <br>Cindua Mato : Raja Mudo adik Bundo Kandung sendiri. Kalau terjadi pertengkaran lalu  <br>  menimbulkan peperangan, siapa yang akan malu? perang saudara itu tidak akan  <br>  pernah selesai turun-temurun. <br>Bundo Kandung: Aku sudah berada di balik semua. Jika kau takut, katakan saja. Perang bukan <br>  barang baru bagi kerajaan. <br>Cindua Mato: Mengapa Bundo Kandung sampai hati ingin mengacaukan perkawinan Putri <br>  Bungsu? Bukankah yang kawin itu anak Bundo Kandung juga? Jika perang <br>  dilaksanakan, kemudian salah seorang mati terbunuh,a pakah kita tega? Dan <br>  bagaimana kata ayahnya nanti, jika kedua anaknya saling berbunuhan? Aku ingin <br>  membuka sedikit selubung hati kita yang tertutup selama ini. <br>Watak tokoh Cindua Mato pada penggalan teks tersebut adalah ... <br>', 1, 'pendendam dan emosional', 'emosional dan penyayang', 'penyayang dan sabar', 'sabar dan emosional', 'sabar dan bijaksana', 'E', NULL, '', '', '', '', '', ''),
(1579, 16, 44, ' Cermatilah dialog berikut! <br>Pardi: (Monolog) &ldquo;Ah, semoga hujan lekas turun kembali. Jika hujan turun, tanaman yang <br>  dahulunya kering bisa hijau kembali.&rdquo; (dari dalam rumah ibunya muncul menemui <br>  anaknya yang sedang menanam pohon) <br>Ibu: &ldquo;Sedang apa kau, Pardi?&rdquo; <br>Pardi: &ldquo;.....&rdquo;<br>Ibu: &ldquo;Kau memang seperti Bapakmu dulu, Pardi. Sewaktu Bapakmu masih hidup, sangat-sangat   gemar menanam pohon-pohon akasia.&rdquo; <br>Kalimat berikut yang tepat untuk melengkapi dialog tersebut adalah .... <br>', 1, 'sedang membaca tanaman akasia, Bu.', 'sedang menyiram akasia, Bu.', 'sedang menyiangi akasia, Bu.', 'sedang mencangkok akasia, Bu.', 'sedang menanam pohon akasia, Bu.', 'D', NULL, '', '', '', '', '', ''),
(1580, 16, 45, ' Cermati paragraf berikut dengan saksama! <br>Sebuah ruangan kamar tamu. Ada beberapa meja dan kursi. Ada sebuah pintu di sebelah kiri untuk keluar dan masuk. Di atas meja, ada beberapa buku. Saat itu, sore hari kira-kira pukul 18.00 lampu belum dinyalakan. <br>Paragraf tersebut dalam naskah drama disebut .... <br>', 1, 'Monolog', 'Dialog', 'Epilog', 'Penokohan', 'Prolog', 'E', NULL, '', '', '', '', '', ''),
(1581, 16, 46, ' Bacalah penggalan drama berikut! <br>Ibu: (Tidak menoleh benar) &ldquo;Malam lebaran Narto, dengarlah tabuh itu bersahut-sahutan. Pada <br>  malam lebaran seperti ini dia pergi, pergi dengan tidak meninggalkan kita.&rdquo; <br>Gunarto: (Agak kesal) &ldquo;Ayah ...? <br>Ibu: &ldquo;Keesokan harinya, hari lebaran, sesudah sembahyang aku memaafkan dosanya.&rdquo; <br>Gunarto: &ldquo;Kenapa ibu ingat juga waktu yang lampau, mengingat kepada orang yang tak pernah lagi <br>  mengingat kita.&rdquo; <br>Ibu: (memandang Gunarto) &ldquo;Aku merasa ia masih ingat kita Gunarto.&rdquo; <br>Hal yang tergambar dalam penggalan drama tersebut adalah konflik.... <br>', 1, 'Sosial', 'Fisik', 'Batin', 'Budaya', 'Alam', 'C', NULL, '', '', '', '', '', ''),
(1582, 16, 47, ' Bacalah penggalan drama berikut! <br>Ibu: &ldquo;Pak Gi ini benar-benar seorang pejuang yang tak pernah melupakan cita-citanya.&rdquo; <br>Anak: &ldquo;Cita-cita yang mana, Bu?&rdquo; <br>Ibu: &ldquo;Bahwa yang tak kalah penting dengan perang melawan kemiskinan dan kebodohan. <br>  Lha ini semua kan bukti keberhasilan beliau melawan kemiskinan? <br>Anak: &ldquo;Ibu sendiri kenapa tidak mengikuti jejak Pak Gi?&rdquo; <br>Ibu: &ldquo;Sebagai mantan bagian dapur umum, saya tetap berjuang terus, lho! Melawan kelaparan <br>  ....&rdquo; <br>Penggambaran watak Pak Gi yang diungkapkan pengarang pada penggalan tersebut melalui .... <br>', 1, 'Ciri-ciri fisik tokoh', 'Lingkungan sekitar tokoh', 'Perbincangan tokoh lain', 'Perasaan tokoh', 'Reaksi tokoh-tokoh lain', 'C', NULL, '', '', '', '', '', ''),
(1583, 16, 48, ' Bacalah kutipan teks drama berikut ini! <br>(Siang di rumah Suseno) <br>Suseno : Apa seluruh penduduk sudah tahu dan mau mengungsi? <br>Ajimin : Sudah. <br>Brata : Para pemuda juga sudah siap. Menjelang tengah malam desa akan kosong. <br>Suseno : Hmm&hellip; kita mulai perjuangan. Sisakan beberapa pemuda untuk menjaga warga desa. <br>Atinah : Kang, berhati - hatilah, aku menunggumu di pengungsian . <br>Suseno : Iya, kita akan melakukan serangan gerilya yang terduga saat mereka membakar desa <br>  dimalam hari. Pasukkan Belanda pasti tidak akan menduganya. <br>Ajimin : Ya sudah, sekarang kita kembali ke rumah masing - masing dan bertemu menjelang malam <br>  di pinggir hutan sebelah barat. <br>Brata : Aku percaya, kita akan berhasil. <br>Berdasarkan pembabakannya, kutipan teks drama tersebut termasuk pada bagian &hellip;. <br>', 1, 'rangsangan', 'eksposisi', 'konflik', 'komplikasi', 'peleraian', 'A', NULL, '', '', '', '', '', ''),
