(2614, 23, 25, ' Usaha yang dilakukan secara sadar untuk memperoleh pengetahuan dengan tujuan untuk mengubah seseorang dari tidak tahu menjadi tahu, mengubah perilaku ke arah yang lebih baik sehingga seseorang tersebut memiliki kecakapan bukan hanya bersifat intelektual tapi juga yang bersifat sosial dan religius. Pernyataan tersebut merupakan pengertian dari ..... <br>', 1, 'Mengamalkan ilmu', 'Menyebarkan ilmu', 'Mengajarkan ilmu', 'Menuntut ilmu', 'Memberi ilmu', 'D', NULL, '', '', '', '', '', ''),
