(2628, 23, 39, ' Bacalah dengan cermat pernyataan-pernyataan di bawah ini! <br>      1) Bersabar dengan tidak membalas terhadap ejekan atau cemoohan teman yang tidak suka terhadap             kamu. <br>      2) Menerima dan menghargai pendapat teman/orang lain meskipun pendapat tersebut berlawanan d          dengan   keinginan kita. <br>      3) Memaafkan kesalahan teman dan orang lain yang berbuat &ldquo;aniaya&rdquo; kepada kita. <br>      4) Ikhlas terhadap segala bentuk cobaan dan musibah yang menimpa, dengan terus berupaya           memperbaiki    diri dan lingkungan. <br>       5) Mengerjakan tugas-tugas yang diberikan kepada kita dengan penuh tanggung jawab. <br>Dari lima pernyataan tersebut yang mencerminkan prilaku pengendalian diri adalah &hellip;.<br>', 1, ' pernyataan nomor 1, 2, dan 3.', ' pernyataan nomor 1, 2, dan 4.', ' pernyataan nomor 1, 3, dan 4.', ' pernyataan nomor 2, 3, dan 4.', ' pernyataan nomor 2, 4, dan 5. ', 'C', NULL, '', '', '', '', '', ''),
