(2630, 23, 41, 'Di bawah ini yang&nbsp;bukan&nbsp;merupakan sikap berhusnuzan kepada orang lain adalah&hellip;.<br>', 1, '  Melihat seseorang dari sisi baiknya, ditunjukkan dengan rasa senang, dan berpikir positif', '  Selalu memaafkan kesalahan yang dilakukan orang lain terhadap dirinya', '  Bersikap hormat pada orang lain tanpa ada rasa curiga, dengki, dan perasaan tidak senang tanpa alasan yang jelas', '  Selalu yakin bahwa Allah Swt. akan senantiasa memberi yang terbaik bagi hamba-Nya', '  Selalu mengingat kebaikan-kebaikan yang pernah dilakukan oleh seseorang ', 'A', NULL, '', '', '', '', '', ''),
(2631, 23, 42, ' Lafal yang bertanda tebal berikut mengandung hukum tajwid&hellip;..<br>يَا أَيُّهَا الَّذِينَ', 1, '  ikhfa&rsquo; syafawi', '  mad jaiz munfasil', '  alif lam syamsiah', '  idgham mumassilain', '  Iqlab ', 'B', NULL, '', '', '', '', '', ''),
(2632, 23, 43, 'Perhatikan narasi berikut ini! <br>Tingginya perhatian Islam untuk menjaga jiwa manusia (al-nafs) dapat dilihat dari diterapkannya hukuman qisas. Adanya ancaman hukuman mati ini, seharusnya menjadikan siapa pun (individu, masyarakat, bahkan negara) harus berpikir ribuan kali untuk melakukan tindakan penghilangan nyawa manusia tanpa sebab yang dibenarkan oleh Islam. Hikmah dari pelakasanaan hukuman qisas yaitu &hellip;.<br>', 1, ' penerapan qisas merupakan upaya melindungi nyawa manusia', ' hukuman qisas akan menjadikan Islam semakin ditakuti', ' semakin banyak orang yang tak mau mendekati agama Islam', ' qisas merupakan hasil kesepakatan para mujtahid', ' memperlebar permusuhan dengan para pembenci Islam', 'A', NULL, '', '', '', '', '', ''),
(2633, 23, 44, 'Hifzhu al-&rsquo;aql dilakukan dengan cara menjaga akal pikiran agar dapat digunakan untuk berpikir. Langkah yang tepat dan efektif untuk menjaga akal adalah semenjak masa kanak-kanak. Mengapa demikian? <br>', 1, ' sangat mudah menanamkan nilai-nilai kebaikan kedalam diri anakanak', ' masa kanak-kanak hanya adalah masa untuk bermain sambil belajar', ' tidak akan banyak menemui kendala saat menanamkan nilai pada diri anak', ' seorang ibu akan sangat mudah membentuk kepribadian anak-anaknya', ' lingkungan tidak punya pengaruh apa pun pada diri anak', 'A', NULL, '', '', '', '', '', ''),
(2634, 23, 45, ' Perhatikan narasi beriku ini! <br>Pada saat Abu Bakar as-Shiddiq r.a menjabat sebagai khalifah, beliau berpidato: &ldquo;bantulah aku jika aku benar, dan jika aku salah maka luruskanlah aku&rdquo;. Karenanya rakyat tak segan untuk mengkritik kebijakan negara dan memberikan pendapat kepada Abu Bakar r.a. Bahkan Abu Bakar as-Shiddiq r.a sering mengundang para sahabat dan masyarakat untuk meminta masukan dan kritik terkait kebijakan negara, dan kepemimpinannya.Berdasarkan narasi tersebut, kebijakan Abu Bakar as-Shiddiq r.a. dalam rangka menjaga &hellip;.<br>', 1, '  agama', '  akal', '  jiwa', '  keturunan', '  harta', 'B', NULL, '', '', '', '', '', ''),
(2635, 23, 46, ' Hendaknya seorang muslim bersikap husnuzhan kepada Allah Swt. Pernyataan di bawah ini yang menunjukkan sikap husnuzhan kepada Allah Swt. adalah .... <br>', 1, ' senantiasa berbahagia dalam hidupnya', ' sabar saat menghadapi kesulitan dan musibah', ' tidak senang pada teman yang suka menyakiti', ' menangis sedih ketika ditinggal wafat ayahnya', ' iri kepada seseorang yang mendapat anugerah ', 'C', NULL, '', '', '', '', '', ''),
(2636, 23, 47, 'Islam adalah agama universal yang syariatnya mudah dilaksanakan oleh umatnya. Tujuan utama syariat Islam adalah menolak kemudaratan. <br>Berikut ini yang termasuk kategori menolak kemudaratan adalah &hellip;.<br>', 1, '  mengharamkan riba dan penipuan', '  kewajiban puasa di bulan Ramadhan', '  salat sunah tahajud pada malam hari', '  anjuran menuntut ilmu', '  perintah menyantuni fakir miskin', 'A', NULL, '', '', '', '', '', ''),
(2637, 23, 48, 'Perhatikan firman Allah Swt. dalam Q.S. az-Zariyat/51: 56 berikut ini! <br>&ldquo;wa mā khalaqtul-jinna wal-insa illā liya&#39;budụn&rdquo;Artinya: &quot;Dan aku tidak menciptakan jin dan manusia melainkan supaya mereka mengabdi kepada-Ku.&quot;Ayat tersebut menegaskan bahwa tugas manusia adalah beribadah kepada Allah Swt. Oleh karena itu diperlukan sarana agar dapat beribadah sesuai aturan syariat. Dalam hal ini al-kulliyattu al-khamsah yang paling dekat kaitannya dengan ibadah yaitu &hellip;.<br>', 1, ' hifzhu al-nafs', ' hifzhu al-din', ' hifzhu al-nasl', ' hifzhu al-mal', ' hifzhu al-&lsquo;aql', 'B', NULL, '', '', '', '', '', ''),
(2638, 23, 49, ' Tidak ada paksaan dalam memilih agama sesuai keyakinannya masingmasing. Hal ini merupakan contoh penerapan dari salah satu al-kulliyatu al-khamsah. Dampak postif dari kebebasan beragama adalah sebagai berikut, kecuali &hellip;.<br>', 1, ' tumbuhnya rasa persatuan dan kesatuan', ' terciptanya suasana damai di masyarakat', ' terwujudnya keharmonisan dalam kehidupan', ' menurunkan tingkat kepercayaan masyarakat', ' terwujudnya kenyamanan dalam beribadah', 'D', NULL, '', '', '', '', '', ''),
